import React from "react";
import "./App.css";
import Movies from "./components/Movies";
import ListGroup from "./components/ListGroup";

function App() {
  return (
    <main role="main" className="container pt-5">
      <div className="d-flex justify-content-between">
        <ListGroup />
        <div className="w-75">
          <Movies />
        </div>
      </div>
    </main>
  );
}

export default App;
